INSERT INTO `course_base` VALUES (25, 1232141425, NULL, 'Bootstrap开发框架', 'Bootstrap是由Twitter推出的一个前台页面开发框架，在行业之中使用较为广泛。此开发框架包含了大量的CSS、JS程序代码，可以帮助开发者（尤其是不擅长页面开发的程序人员）轻松的实现一个不受浏览器限制的精美界面效果。', NULL, '1-1', '1-1-1', '200002', '200002', 'Bootstrap是由Twitter推出的一个前台页面开发框架，在行业之中使用较为广泛。此开发框架包含了大量的CSS、JS程序代码，可以帮助开发者（尤其是不擅长页面开发的程序人员）轻松的实现一个不受浏览器限制的精美界面效果。', '/mediafiles/2022/12/18/c051fe97e672dd399902a90f4ac67962.jpg', '2019-09-04 09:56:19', '2022-12-18 12:14:49', NULL, NULL, '202002', '203001');
INSERT INTO `course_base` VALUES (26, 1232141425, NULL, 'spring cloud实战', '所有人', NULL, '1-3', '1-3-2', '200003', '200002', '本课程主要从四个章节进行讲解： 1.微服务架构入门 2.spring cloud 基础入门 3.实战Spring Boot 4.注册中心eureka。', 'https://cdn.educba.com/academy/wp-content/uploads/2018/08/Spring-BOOT-Interview-questions.jpg', '2019-09-04 09:56:19', '2023-03-28 16:32:44', NULL, NULL, '202002', '203001');
INSERT INTO `course_base` VALUES (27, 1232141425, NULL, 'Javascript之VueJS', '所有人', NULL, '1-1', '1-1-9', '200002', '200002', 'Vue系列课程：从Vue1.0讲到Vue2.0，从理论讲到实战，理论与案例巧妙结合，让课程更容易理解！', 'https://cdn.educba.com/academy/wp-content/uploads/2018/08/Spring-BOOT-Interview-questions.jpg', '2019-09-04 09:56:19', NULL, NULL, NULL, '202002', '203001');
INSERT INTO `course_base` VALUES (28, 1232141425, NULL, 'Redis从入门到项目实战', 'test', 'tedy', '1-3', '1-3-2', '200002', '200002', 'redis在当前的大型网站和500强企业中，已被广泛应用。 redis是基于内存的key-value数据库，比传统的关系型数据库在性能方面有非常大的优势。 肖老师这套视频，精选了redis在实际项目中的十几个应用场景。通过本课程的学习，可以让学员快速掌握redis在实际项目中如何应用。 作为架构师，redis是必须要掌握的技能！', '/mediafiles/2023/03/21/33ff62f024bdac03453966fd9d37f16b.png', '2019-09-04 09:56:19', '2023-03-28 17:54:28', NULL, NULL, '202002', '203001');
INSERT INTO `course_base` VALUES (39, 1, NULL, 'SpringBoot核心11111', 'Spring Boot初学者', 'Spring项目的快速构建', '1-3', '1-3-2', '200003', '200002', '课程系统性地深度探讨 Spring Boot 核心特性，引导小伙伴对 Java 规范的重视，启发对技术原理性的思考，掌握排查问题的技能，以及学习阅读源码的方法和技巧，全面提升研发能力，进军架构师队伍。', 'https://cdn.educba.com/academy/wp-content/uploads/2018/08/Spring-BOOT-Interview-questions.jpg', '2019-09-10 16:03:51', '2019-09-11 14:53:17', NULL, NULL, '202002', '203001');
INSERT INTO `course_base` VALUES (40, 1232141425, NULL, 'SpringBoot核心', 'Spring Boot初学者', 'Spring项目的快速构建', '1-3', '1-3-2', '200003', '200002', '课程系统性地深度探讨 Spring Boot 核心特性，引导小伙伴对 Java 规范的重视，启发对技术原理性的思考，掌握排查问题的技能，以及学习阅读源码的方法和技巧，全面提升研发能力，进军架构师队伍。', 'https://cdn.educba.com/academy/wp-content/uploads/2018/08/Spring-BOOT-Interview-questions.jpg', '2019-09-10 16:05:39', '2022-09-16 08:07:41', NULL, NULL, '202002', '203001');
