INSERT INTO `course_base` VALUES (121, 1232141425, NULL, 'Spring Cloud 开发实战', '具有web开发基础', '', '1-3', '1-3-2', '204002', '200002', 'Spring Cloud是一系列框架的有序集合。它利用Spring Boot的开发便利性巧妙地简化了分布式系统基础设施的开发，如服务发现注册、配置中心、消息总线、负载均衡、断路器、数据监控等，都可以用Spring Boot的开发风格做到一键启动和部署。Spring Cloud并没有重复制造轮子，它只是将各家公司开发的比较成熟、经得起实际考验的服务框架组合起来，通过Spring Boot风格进行再封装屏蔽掉了复杂的配置和实现原理，最终给开发者留出了一套简单易懂、易部署和易维护的分布式系统开发工具包。', '/mediafiles/2023/03/31/1c3929f89a96cf9a0e001225b805ced7.jpg', '2023-02-09 11:10:42', '2023-04-01 21:03:15', NULL, NULL, '202004', '203002');
