INSERT INTO `course_publish` VALUES (121, 1232141425, NULL, 'Spring Cloud 开发实战', '具有web开发基础', '', NULL, '1-3', '编程开发', '1-3-2', 'Java', '204002', '200002', '/mediafiles/2023/03/31/1c3929f89a96cf9a0e001225b805ced7.jpg', 'Spring Cloud是一系列框架的有序集合。它利用Spring Boot的开发便利性巧妙地简化了分布式系统基础设施的开发，如服务发现注册、配置中心、消息总线、负载均衡、断路器、数据监控等，都可以用Spring Boot的开发风格做到一键启动和部署。Spring Cloud并没有重复制造轮子，它只是将各家公司开发的比较成熟、经得起实际考验的服务框架组合起来，通过Spring Boot风格进行再封装屏蔽掉了复杂的配置和实现原理，最终给开发者留出了一套简单易懂、易部署和易维护的分布式系统开发工具包。', '{\"charge\":\"201001\",\"id\":121,\"originalPrice\":100.0,\"phone\":\"432432\",\"price\":1.0,\"qq\":\"2323232\",\"validDays\":365,\"wechat\":\"3232432\"}', '[{\"courseId\":121,\"grade\":1,\"id\":281,\"orderby\":1,\"parentid\":0,\"pname\":\"第1章 SpringCloud概述\",\"teachPlanTreeNodes\":[{\"courseId\":121,\"grade\":2,\"id\":283,\"orderby\":2,\"parentid\":281,\"pname\":\"Spring Cloud与SpringBoot的关系\",\"teachplanMedia\":{\"courseId\":121,\"id\":77,\"mediaFilename\":\"01_尚硅谷_MySQL基础_课程引入.avi\",\"mediaId\":\"b2b57410a0064a947049a85b3a0576ab\",\"teachplanId\":283}}]},{\"courseId\":121,\"grade\":1,\"id\":284,\"orderby\":2,\"parentid\":0,\"pname\":\"第2章 基础组件\",\"teachPlanTreeNodes\":[{\"courseId\":121,\"grade\":2,\"id\":285,\"orderby\":1,\"parentid\":284,\"pname\":\"服务注册中心\",\"teachplanMedia\":{\"courseId\":121,\"id\":78,\"mediaFilename\":\"02_尚硅谷_MySQL基础_为什么学习数据库.avi\",\"mediaId\":\"8e5e300f3c407f4a27d73412dea45010\",\"teachplanId\":285}},{\"courseId\":121,\"grade\":2,\"id\":286,\"orderby\":2,\"parentid\":284,\"pname\":\"配置中心\",\"teachplanMedia\":{\"courseId\":121,\"id\":79,\"mediaFilename\":\"03_尚硅谷_MySQL基础_数据库的相关概念.avi\",\"mediaId\":\"cbefa6bb237f78ff286d651943fab69e\",\"teachplanId\":286}},{\"courseId\":121,\"grade\":2,\"id\":287,\"orderby\":3,\"parentid\":284,\"pname\":\"负载均衡\",\"teachplanMedia\":{\"courseId\":121,\"id\":80,\"mediaFilename\":\"04_尚硅谷_MySQL基础_数据库存储数据的特点.avi\",\"mediaId\":\"56252ccf4c1742c381d6e721c07e1d32\",\"teachplanId\":287}},{\"courseId\":121,\"grade\":2,\"id\":288,\"orderby\":4,\"parenti